import React, { useState } from "react";
import { Button, Modal, Carousel } from "antd";

const ProjectModal = ({ open, onClose, meta, other, backStage }) => {
  const imageSrc = {
    meta: [
      {
        src: "/images/meta/meta-1.png",
      },
      {
        src: "/images/meta/meta-2.png",
      },
      {
        src: "/images/meta/meta-3.png",
      },
      {
        src: "/images/meta/meta-4.png",
      },
      {
        src: "/images/meta/meta-5.png",
      },
      {
        src: "/images/meta/meta-6.png",
      },
      {
        src: "/images/meta/meta-7.png",
      },
      {
        src: "/images/meta/meta-8.png",
      },
      {
        src: "/images/meta/meta-9.png",
      },
    ],
    other: [
      {
        src: "/images/meta/lottery1.png",
      },
      {
        src: "/images/meta/lottery2.png",
      },
      {
        src: "/images/meta/lottery3.png",
      },
      {
        src: "/images/meta/lottery4.png",
      },
      {
        src: "/images/meta/crypto1.png",
      },
      {
        src: "/images/meta/crypto2.png",
      },
      {
        src: "/images/meta/crypto3.png",
      },
      {
        src: "/images/meta/block1.png",
      },
      {
        src: "/images/meta/block2.png",
      },
      {
        src: "/images/meta/block3.png",
      },
      {
        src: "/images/meta/block4.png",
      },
    ],
    backstage: [
      {
        src: "/images/meta/backstage1.png",
      },
      {
        src: "/images/meta/backstage2.png",
      },
      {
        src: "/images/meta/backstage3.png",
      },
      {
        src: "/images/meta/backstage4.png",
      },
      {
        src: "/images/meta/backstage5.png",
      },
      {
        src: "/images/meta/backstage6.png",
      },
    ],
  };

  return (
    <Modal title="Modal 1000px width" centered open={open} onCancel={onClose}>
      <Carousel autoplay>
        {meta
          ? imageSrc.meta.map((i) => {
              return (
                <div>
                  <img src={i.src} alt="meta" />
                </div>
              );
            })
          : other
          ? imageSrc.other.map((i) => {
              return (
                <div>
                  <img src={i.src} alt="meta" />
                </div>
              );
            })
          : ""}
        {backStage
          ? imageSrc.backstage.map((i) => {
              return (
                <div>
                  <img src={i.src} alt="meta" />
                </div>
              );
            })
          : ""}
      </Carousel>
    </Modal>
  );
};

export default ProjectModal;
